import { ref, onMounted } from 'vue';
import axios from 'axios';
export default {
  name: 'About',
  setup() {
    const profile = ref({
      name: '',
      subtitle: '',
      skills: [],
      social: []
    });
    const fetchProfile = async () => {
      try {
        const response = await axios.get('/api/profile.php');
        if (response.data) {
          profile.value = response.data;
        }
      } catch (error) {
        console.error('Error fetching profile:', error);
      }
    };
    onMounted(() => {
      fetchProfile();
    });
    return {
      profile
    };
  }
};
